import React from 'react';
import "../Header/Header.scss";
import bfLogo from "../../assets/Logo/Logo-brainflix.svg"
import avatar from "../../assets/Images/Mohan-muruge.jpg"

function Header() {
    return (
        <div>
        <header className="header">
        <img src={bfLogo} alt = "Logo" className="header__logo"/>
        <div className="header__content">
        <label htmlFor="text"></label>
            <input className="searchIcon" type="text" id="text" name= "search" placeholder="Search"/>
            <button type="submit" id="comment__button">+ UPLOAD</button> <img src={avatar} alt = "avatar" />
        </div>
        </header>
            
        </div>
    )
}

export default Header
